import { UilUserExclamation } from '@iconscout/react-unicons'
import React from 'react';


const Middel = () => {
    return (
    <div className="MainMiddel">
        <div className='BigBox'>
            <div className='Col-'></div>
        </div>
    </div>
    );
}
 
export default Middel;
